import { Container, Form, Button, Card } from 'react-bootstrap';
import './App.css';
import NavBar from './NavBar';

function App() {
  return (
    <>
      <NavBar />
      <Container className="standard-container">
        <Card style={{ width: '18rem' }}>
          <Card.Body>
            <Card.Title>All Lights</Card.Title>
            {/* <Card.Subtitle>Main control switch</Card.Subtitle> */}
            <div className="d-grid gap-2">
              <Button variant="primary" size="lg">On</Button>
              <Button variant="secondary" size="lg">Off</Button>
            </div>
            <Form.Label>Range</Form.Label>
            <Form.Range />
          </Card.Body>
        </Card>
      </Container>
    </>
  );
}

export default App;
